const express = require('express');
var bodyParser = require('body-parser');

const app = express();
const port = 5001;

app.use(bodyParser.urlencoded({ extended: false }))
app.use(bodyParser.json());

app.get('/', (req, res) => {
    log('GET /');
    res.send('Welcome to recipe finder mock server! Use the Postman deck to access all APIs.');
    console.log();
});

app.post('/registration', (req, res) => {
    log('POST /registration');
    if (!req.body.name || !req.body.email || !req.body.password) {
        log('Bad request.');
        res.status(400).send({
            message: "Bad credentials."
        });
    } else {
        log('All good.');
        res.status(200).send();
    }
    console.log();
});

app.post('/login', (req, res) => {
    log('POST /login');
    if (!req.body.email || !req.body.password) {
        log('Bad request.');
        res.status(400).send({
            message: "Bad input."
        });
    } else if (req.body.password !== '12345') {
        log('Wrong credentials.')
        res.status(401).send({
            message: "Wrong credentials."
        });
    } else {
        log('All good.');
        res.status(200).send();
    }
    console.log();
});

app.post('/recipe', (req, res) => {
    log('POST /recipe');
    if (!req.body.email || !req.body.name || !req.body.ingredients || !req.body.steps || !req.body.photo || !req.body.estimated_time || !req.body.food_type) {
        res.status(400).send({
            message: "Either of email, name, ingredients, steps, photo, estimated_time, or food_type are missing."
        });
    } else {
        log('All good.');
        res.status(200).send();
    }
    console.log();
});

app.get('/recipes', (req, res) => {
    log('GET /recipes');
    res.send([
        {
            name: "Dal Tadka",
            ingredients: "Moong dal, onions, tomatoes, turmeric powder",
            steps: "Sorte onions, add tomatoes, put everything into a cooker",
            photo: "data:image/jpeg;base64,",
            estimated_time: 0,
            food_type: ""
        },
        {
            name: "Pulav",
            ingredients: "Rice, onions, tomatoes, turmeric powder",
            steps: "Wash rice, sorte onions, add tomatoes, put everything into a cooker",
            photo: "data:image/jpeg;base64,",
            estimated_time: 0,
            food_type: ""
        },
    ]);
    console.log();
});

app.put('/recipe', (req, res) => {
    log('PUT /recipe');
    if (!req.body.name || !req.body.email) {
        log('Bad request.');
        res.status(400).send({
            message: "Either name or email or both are missing."
        });
    } else {
        log('All good.');
        res.status(200).send();
    }
    console.log();
});

app.delete('/recipe', (req, res) => {
    log('DELETE /recipe');
    if (!req.body.name || !req.body.email) {
        log('Bad request.')
        res.status(400).send({
            message: "Either name or email or both are missing."
        });
    } else {
        log('All good.')
        res.status(200).send();
    }
    console.log();
});

app.listen(port, () => {
    log(`Recipe finder mock server listening on port ${port}.`);
    console.log();
});

function log(msg) {
    let date = new Date();
    date = `[${date.getDate()} | ${date.getHours()}:${date.getMinutes()}] `;
    console.log(date + msg);
}